function make_prim_info(tag, size, scalar_type, array_type, create_array, get_heap) {
  return {
    tag: tag, // tag used in the binary data format
    size: size,
    scalar_type: scalar_type,
    array_type: array_type,
    get_heap: get_heap,
    create_array: create_array,
  };
}

